import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import AlumnChanging from '../AlumnChanging/AlumnChanging'

const Home = () => {
  return (
    <Router>
        <div>
        <h1>Mi Componente</h1>
        <p>Este es un componente de ejemplo en React.</p>
        </div>
    </Router>
  );
}

export default Home;
